selector_to_html = {"a[href=\"#using-metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Using Metadata<a class=\"headerlink\" href=\"#using-metadata\" title=\"Permalink to this heading\">#</a></h2><p>Each pipeline comes stocked with methods to retrieve imaging metadata.</p>", "a[href=\"#pipelines\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pipelines<a class=\"headerlink\" href=\"#pipelines\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"#term-Field-of-view\"]": "<dt id=\"term-Field-of-view\">Field-of-view</dt><dd><p>The total size (um) of the raw stitched image with no trimming operations.</p></dd>", "a[href=\"#understanding-metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Understanding Metadata<a class=\"headerlink\" href=\"#understanding-metadata\" title=\"Permalink to this heading\">#</a></h2><p id=\"scanimage-metadata\">ScanImage stores metadata about image size, frame rate, resolution, and regions of interest within the raw <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> file. Each pipeline handles this metadata for you, and provides an interface to use these values throughout the pipeline.</p><p>There is primary metadata, intended for use in a typical processing run. Many of these values are derived from less-pertinent (secondary) metadata.</p>", "a[href=\"#term-pixel-resolution\"]": "<dt id=\"term-pixel-resolution\">pixel-resolution</dt><dd><p>The size, in micron, of each pixel.</p></dd>", "a[href=\"guides/mbo_servers.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2. </span>Server Guide<a class=\"headerlink\" href=\"#server-guide\" title=\"Permalink to this heading\">#</a></h1><p>As a user of MBO servers you will be given a login and a password to on a Windows Server 2022 desktop to be used with windows remote desktop.\nThis login will give you access to all of the resources of that server, shared with a limited number of other users.</p>", "a[href=\"#term-region-of-interest\"]": "<dt id=\"term-region-of-interest\">region-of-interest</dt><dd><p>A set of 1 or more 2D planes which are stitched together to form the full image.</p></dd>", "a[href=\"guides/lbm_datasets.html#metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1. </span>Metadata<a class=\"headerlink\" href=\"#metadata\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"#external-resources\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">External Resources<a class=\"headerlink\" href=\"#external-resources\" title=\"Permalink to this heading\">#</a></h2><h3>Software<a class=\"headerlink\" href=\"#software\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"#term-num_pixel_xy\"]": "<dt id=\"term-num_pixel_xy\">num_pixel_xy</dt><dd><p>The number of pixels [X, Y] in each <a class=\"reference internal\" href=\"#term-region-of-interest\"><span class=\"xref std std-term\">region-of-interest</span></a>.</p></dd>", "a[href=\"#term-roi_height_px\"]": "<dt id=\"term-roi_height_px\">roi_height_px</dt><dd><p>The size of the <a class=\"reference internal\" href=\"#term-region-of-interest\"><span class=\"xref std std-term\">region-of-interest</span></a> on its longest dimension.</p></dd>", "a[href=\"#term-image-length\"]": "<dt id=\"term-image-length\">image-length</dt><dd><p>The number of pixels on the long axis of the raw <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> file.</p></dd>", "a[href=\"guides/lbm_datasets.html#scanimage-metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.4. </span>ScanImage metadata<a class=\"headerlink\" href=\"#scanimage-metadata\" title=\"Permalink to this heading\">#</a></h2><p>Each pipeline comes stocked with methods to retrieve imaging metadata.</p>", "a[href=\"guides/lbm_datasets.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1. </span>Exploring LBM Datasets<a class=\"headerlink\" href=\"#exploring-lbm-datasets\" title=\"Permalink to this heading\">#</a></h1><p>Light-beads microscopy is a 2-photon imaging paradigm based on <a class=\"reference external\" href=\"https://docs.scanimage.org\">ScanImage</a> acquisition software.</p>", "a[href=\"#blogs-and-posts\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Blogs and Posts<a class=\"headerlink\" href=\"#blogs-and-posts\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"guides/mbo_servers.html#software\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2. </span>Software<a class=\"headerlink\" href=\"#software\" title=\"Permalink to this heading\">#</a></h2><h3><span class=\"section-number\">2.2.1. </span>miniforge3<a class=\"headerlink\" href=\"#miniforge3\" title=\"Permalink to this heading\">#</a></h3><p>Each user account has its own <code class=\"docutils literal notranslate\"><span class=\"pre\">Miniforge3</span></code> installation at <code class=\"docutils literal notranslate\"><span class=\"pre\">C:/Users/miniforge3</span></code>.</p><p>This is your environment to install and reinstall as you please. <em>DO NOT</em> install any software in the base environment as that will cause conflicts between all installed environments and require a reinstallation of miniforge3.</p>", "a[href=\"guides/lbm_datasets.html#frame-ordering\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.3. </span>Frame Ordering<a class=\"headerlink\" href=\"#frame-ordering\" title=\"Permalink to this heading\">#</a></h2><p>ScanImage saves the 4D volume with each plane interleaved, e.g.</p>", "a[href=\"ref.html#ex-deinterleave\"]": "<figure class=\"align-default\" id=\"ex-deinterleave\">\n<img alt=\"ex_deinterleave\" src=\"ex_deinterleave.svg\"/><figcaption>\n<p><span class=\"caption-text\">De-interleave Z-Planes</span><a class=\"headerlink\" href=\"#ex-deinterleave\" title=\"Permalink to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"guides/lbm_datasets.html#terms\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.2. </span>Terms<a class=\"headerlink\" href=\"#terms\" title=\"Permalink to this heading\">#</a></h2><p>In its raw form, data is saved as a 3-dimensional multi-page tiff file. Each image within this tiff file represents a page of the original document.</p>", "a[href=\"guides/mbo_servers.html#filesystem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.1. </span>Filesystem<a class=\"headerlink\" href=\"#filesystem\" title=\"Permalink to this heading\">#</a></h2><p>!Note: Both workstation and compute file-systems are <em>NOT</em> backed up. Users should have a backup of all data on their own system.</p><p>The <code class=\"docutils literal notranslate\"><span class=\"pre\">D:</span></code> drive is <strong>read-only</strong> and contains</p>", "a[href=\"#terms\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Terms<a class=\"headerlink\" href=\"#terms\" title=\"Permalink to this heading\">#</a></h2><p>Light-beads microscopy is a 2-photon imaging paradigm based on <a class=\"reference external\" href=\"https://docs.scanimage.org/index.html\">ScanImage</a> acquisition software.</p>", "a[href=\"#documentation-contents\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Documentation Contents<a class=\"headerlink\" href=\"#documentation-contents\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"#frame-ordering\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Frame Ordering<a class=\"headerlink\" href=\"#frame-ordering\" title=\"Permalink to this heading\">#</a></h2><p>ScanImage saves raw tiffs with each z-depth and timepoint interleaved [zT]:</p>", "a[href=\"#term-image-width\"]": "<dt id=\"term-image-width\">image-width</dt><dd><p>The number of pixels on the short, slow-galvo axis of the raw <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> file.</p></dd>", "a[href=\"#light-beads-microscopy-data\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Light Beads Microscopy Data<a class=\"headerlink\" href=\"#light-beads-microscopy-data\" title=\"Permalink to this heading\">#</a></h2><p>Current Light Beads Microscopy (LBM) data is aquired with ScanImage aquisition software.</p><p>ScanImage <a class=\"reference external\" href=\"https://docs.scanimage.org/Premium+Features/Multiple+Region+of+Interest+(MROI).html\">Multi Region Of Interest (mROI)</a> outputs raw <code class=\"docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> files made up of individual <code class=\"docutils literal notranslate\"><span class=\"pre\">Regions</span> <span class=\"pre\">of</span> <span class=\"pre\">Interest</span> <span class=\"pre\">(ROI's)</span></code>.</p>", "a[href=\"#term-roi_width_px\"]": "<dt id=\"term-roi_width_px\">roi_width_px</dt><dd><p>The size of the <a class=\"reference internal\" href=\"#term-region-of-interest\"><span class=\"xref std std-term\">region-of-interest</span></a> on its shortest dimension.</p></dd>", "a[href=\"#software\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Software<a class=\"headerlink\" href=\"#software\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"#miller-brain-observatory-compute-ecosystem\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Miller Brain Observatory: Compute Ecosystem<a class=\"headerlink\" href=\"#miller-brain-observatory-compute-ecosystem\" title=\"Permalink to this heading\">#</a></h1><p>A hub for tutorials, guides and resources for computational image processing.</p>", "a[href=\"ref.html#multipage-tiff\"]": "<figure class=\"align-default\" id=\"multipage-tiff\">\n<img alt=\"Multipage Tiff\" src=\"gen_array_page.gif\"/>\n<figcaption>\n<p><span class=\"caption-text\">MultiPage Tiff</span><a class=\"headerlink\" href=\"#multipage-tiff\" title=\"Permalink to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"guides/index.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Guides<a class=\"headerlink\" href=\"#guides\" title=\"Permalink to this heading\">#</a></h1><p>Guides for users analyzing microscopy data.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
